"   <div class=\"block mop drugH1Div\" id=\"F216245\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Vital signs; fasting lipid profile and fasting blood glucose/Hgb A",
"     <sub>",
"      1c",
"     </sub>",
"     (prior to treatment, at 3 months, then annually); CBC frequently during first few months of therapy in patients with pre-existing low WBC or a history of drug-induced leukopenia/neutropenia; BMI, personal/family history of obesity, waist circumference; mental status, abnormal involuntary movement scale (AIMS). Weight should be assessed prior to treatment, at 4 weeks, 8 weeks, 12 weeks, and then at quarterly intervals. Consider titrating to a different antipsychotic agent for a weight gain &ge;5% of the initial weight. Patients should have eyes checked for cataracts every 6 months while on this medication. Observe for new or worsening depression, anxiety, irritability, aggression, or other symptoms of unusual behavior, mood, or suicide ideation (especially at the beginning of therapy or when doses are increased or decreased).",
"    </p>",
"   </div>",
