"   <div class=\"block pha drugH1Div\" id=\"F216237\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Quetiapine is a dibenzothiazepine atypical antipsychotic. It has been proposed that this drug's antipsychotic activity is mediated through a combination of dopamine type 2 (D",
"     <sub>",
"      2",
"     </sub>",
"     ) and serotonin type 2 (5-HT",
"     <sub>",
"      2",
"     </sub>",
"     ) antagonism. It is an antagonist at multiple neurotransmitter receptors in the brain: Serotonin 5-HT",
"     <sub>",
"      1A",
"     </sub>",
"     and 5-HT",
"     <sub>",
"      2",
"     </sub>",
"     , dopamine D",
"     <sub>",
"      1",
"     </sub>",
"     and D",
"     <sub>",
"      2",
"     </sub>",
"     , histamine H",
"     <sub>",
"      1",
"     </sub>",
"     , and adrenergic alpha",
"     <sub>",
"      1",
"     </sub>",
"     - and alpha",
"     <sub>",
"      2",
"     </sub>",
"     -receptors;  but appears to have no appreciable affinity at cholinergic muscarinic and benzodiazepine receptors. Norquetiapine, an active metabolite, differs from its parent molecule by exhibiting high affinity for muscarinic M1 receptors.",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;text-align:justify;\">",
"     Antagonism at receptors other than dopamine and 5-HT",
"     <sub>",
"      2",
"     </sub>",
"     with similar receptor affinities may explain some of the other effects of quetiapine. The drug's antagonism of histamine H",
"     <sub>",
"      1",
"     </sub>",
"     -receptors may explain the somnolence observed. The drug's antagonism of adrenergic alpha",
"     <sub>",
"      1",
"     </sub>",
"     -receptors may explain the orthostatic hypotension observed.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F216252\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Rapidly absorbed following oral administration",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 6-14 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding, plasma: 83%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Primarily hepatic; via CYP3A4; forms the metabolite N-desalkyl quetiapine (active) and two inactive metabolites",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: 100% (relative to oral solution)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Mean: Terminal: Quetiapine: ~6 hours; Extended release: ~7 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Metabolite: N-desalkyl quetiapine: 9-12 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, plasma: Immediate release: 1.5 hours; Extended release: 6 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (73% as metabolites, &lt;1% of total dose as unchanged drug); feces (20%)",
"    </p>",
"   </div>",
