var script_f19_56_20363=[""].join("\n");
var outline_f19_56_20363=null;
var title_f19_56_20364="Initial assessment cocaine";
var content_f19_56_20364=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F75706&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F75706&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Initial assessment of the cocaine-abusing patient",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       I. Patient history",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       a. Use of all psychoactive substances (not just cocaine), including illegal, prescription, and over-the-counter as well as duration, quantity, frequency, route of administration, and effects for each substance used",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       b. Prior treatment, if any",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       c. Psychiatry history, including relationship of any psychiatric symptoms to substance use or withdrawal",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       d. Medical history",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       e. Social and developmental history, especially current social network",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       II. Family history",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       a. Substance use",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       b. Psychiatric history",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       III. Mental status",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       a. Insight into condition",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       b. Motivation and preferences for treatment",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       c. Cognitive function",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Orientation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Attention span",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Memory, short- and long-term",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Decision-making capacity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       d. Presence of thought disorder, eg, delusions, hallucinations",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       e. Mood and affect",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       IV. Physical examination",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       a. Vital signs",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       b. Heart, lungs, abdomen, extremities, skin",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       c. Neurological examination",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       V. Laboratory tests",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       a. Blood or urine drug testing",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       b. Electrocardiogram",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       c. Complete blood count (CBC)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       d. Blood chemistries, including liver tests",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       e. Blood-borne and sexually transmitted diseases, eg, HIV, syphilis, hepatitis B and C",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Rawson, RA (ed). Treatment for Stimulant Use Disorders (TIPS #33). Center for Substance Abuse Treatment, Rockville, MD 1999.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
